import React from "react";
import SearchInput from "./searchInput";
import { ReactComponent as HomeIcon } from "../../assets/home.svg"; // Asegúrate de que la ruta sea correcta
import "./index.css";

const SearchBox = ({ onSearch }) => {
    return (
        <div className="search-container"> {/* Nuevo contenedor */}
            <div className="search-box">
                <HomeIcon className="home-icon" /> {/* Icono de la casita */}
                <SearchInput onChange={onSearch} />
            </div>
        </div>
    );
};

export default SearchBox;
